class Solution:
    def maxOperations(self, s: str) -> int:
        res = cnt = 0
        for i in range(len(s)):           
            if s[i] == '0' and i and s[i - 1] == '1':
                res += cnt      
                #print(i , res)                  
            cnt += int(s[i])
        return res
